import PropTypes from "prop-types";
import { useState } from "react";
import { useLocales } from "../../locales";
// @mui
import {
  Box,
  Stack,
  Pagination,
  PaginationItem,
  FormControl,
  Select,
  MenuItem,
} from "@mui/material";
import { makeStyles } from "@material-ui/core/styles";
// icons
import KeyboardDoubleArrowRightIcon from "@mui/icons-material/KeyboardDoubleArrowRight";
import KeyboardDoubleArrowLeftIcon from "@mui/icons-material/KeyboardDoubleArrowLeft";
import ArrowDropDownIcon from "@mui/icons-material/ArrowDropDown";
// redux
import { useDispatch } from "react-redux";
// services
import {
  getMarketChainRanking,
  getResturantChainRanking,
} from "../../redux/services/rank_service";

// ----------------------------------------------------------------------

RankPagination.propTypes = {
  dense: PropTypes.bool,
  onChangeDense: PropTypes.func,
  rowsPerPageOptions: PropTypes.arrayOf(PropTypes.number),
  sx: PropTypes.object,
};

// ------ Style -----
// to handle color when switch is checked

const useStyles = makeStyles((theme) => ({
  root: {
    "& .MuiPaginationItem-icon": {
      color: "#FFCC63;",
    },
  },
}));

const selectSx = {
  minWidth: "70px",
  "& .MuiOutlinedInput-root": {
    pr: "8px!important",
  },
  "& .MuiOutlinedInput-input": {
    pr: "20px!important",
    color: "#BCBCBC",
    fontWeight: "400",
    fontSize: "12.9807px",
    pt: "5px!important",
    pb: "5px!important",
  },
  "& .MuiSvgIcon-root": {
    color: "#BCBCBC",
    right: "0px !important",
  },

  "& fieldset": {
    borderWidth: "0px!important",
  },
};

const titleStyle = {
  color: "#BCBCBC",
  fontWeight: "400",
  fontSize: "12.9807px",
  lineHeight: "19px",
};

const mainHolderSx = {
  textAlign: "center",
  alignItems: "center",
  paddingBottom: "27px",
  paddingRight: "24px",
  paddingLeft: "24px",
  display: "flex",
  justifyContent: "space-between",
  flexDirection: { xs: "column", sm: "row" },
};

export default function RankPagination({
  dates,
  dense,
  onRowsPerPageChange,
  onChangeDense,
  onPageChange,
  rowsPerPageOptions = [5, 10],
  sx,
  ...other
}) {
  const dispatch = useDispatch();

  const { translate } = useLocales();

  const [rows, setRows] = useState(5);

  const handleChange = (event) => {
    setRows(event.target.value);
    if (localStorage.getItem("facilityType") === "0") {
      dispatch(
        getResturantChainRanking({
          pageNumber: 1,
          ...dates,
        })
      );
    }
    if (localStorage.getItem("facilityType") === "1") {
      dispatch(
        getMarketChainRanking({
          pageNumber: 1,
          ...dates,
        })
      );
    }

    onRowsPerPageChange(event);
  };

  const classes = useStyles();

  const handlePaginate = (e) => {
    dispatch(
      getResturantChainRanking({
        pageNumber: +e.target.innerText,
        ...dates,
      })
    );
  };
  // ------------- JSX Code -------------
  return (
    <>
      {/* --- Strat Table Pagenation --- */}
      <Box sx={{ ...mainHolderSx }}>
        {/* *** number of Rows Select *** */}
        <Box display="flex" alignItems="center">
          <FormControl sx={{ ...selectSx }}>
            <Select
              IconComponent={(props) => <ArrowDropDownIcon {...props} />}
              value={rows}
              onChange={handleChange}
              displayEmpty
              inputProps={{ "aria-label": "Without label" }}
            >
              <MenuItem sx={{ ...titleStyle }} value={5}>
                <em>5 {translate(`rows_per_page`)}</em>
              </MenuItem>
              <MenuItem sx={{ ...titleStyle }} value={10}>
                <em>10 {translate(`rows_per_page`)}</em>
              </MenuItem>
            </Select>
          </FormControl>
        </Box>

        {/* ***  number of Pages *** */}
        <Stack className={classes.root} textAlign={"right"}>
          <Pagination
            onChange={(e) => handlePaginate(e)}
            count={5}
            color="primary"
            renderItem={(item) => (
              <PaginationItem
                slots={{
                  previous: KeyboardDoubleArrowLeftIcon,
                  next: KeyboardDoubleArrowRightIcon,
                }}
                {...item}
              />
            )}
          />
        </Stack>
      </Box>
    </>
  );
}
